import React from 'react';
import { ContactContainer, ContactListItem } from './contact.styles';
const ContactPage = () => (
  <ContactContainer>
    <h2>This work was made by</h2>
    <ul>
      <ContactListItem>
        safouman{' '}
        <a href="https://icon-library.net/icon/github-icon-svg-13.html">
          Github Icon Svg #158734
        </a>
      </ContactListItem>
      <ContactListItem>safouman instagram</ContactListItem>
      <ContactListItem>safouman Medium</ContactListItem>
    </ul>
  </ContactContainer>
);

export default ContactPage;
